(3106, 'S/N', '2021-08-31', 1, 377, 406, '2021-08-31', '20:08', 2, 'EN RESPUESTA A LA CÉDULA DE NOTIFICACIÓN DE RECOMENDACIONES COMUNICADA MEDIANTE OFICIO AJU/20/688 CON LOS OFICIOS OM/IL/0163/2021 Y CCDMX/IL/T/0596/2021, EL ÓRGANO DE GOBIERNO PRESENTÓ DIVERSA DOCUMENTACIÓN E INFORMACIÓN DE CUYO ANÁLISIS SE DETERMINÓ QUE NO FUE SUFICIENTE PARA DAR ATENDIDAS LAS RECOMENDACIONES NÚMERO ASCM-136-18-4-CONGRESO Y ASCM-137-18-4CONGRESO, DERIVADAS DE LA REVISIÓN DE LA CUENTA PÚBLICA CORRESPONDIENTE AL EJERCICIO 2018. SOLICITA QUE DENTRO DE UN PLAZO DE 10 DÍAS HÁBILES ENVÍE LA INFORMACIÓN Y DOCUMENTACIÓN COMPLEMENTARIA QUE SE INDICA EN ANEXO.', 3, '2021-09-01 01:27:45', 2),
(3107, 'S/N', '2021-08-31', 2, 377, 406, '2021-08-31', '20:20:46', 2, 'EN RESPUESTA AL OFICIO NO. AJU/21/104 CON EL OFICIO NO. OM/IL/0226/2021, DE CUYO ANÁLISIS SE DETERMINÓ QUE NO FUE SUFICIENTE PARA DAR POR ATENDIDAS LA AUDITORIAS QUE SE MENCIONAN EN EL OFICIO, DERIVADAS DE LA REVISIÓN DE LA CUENTA PÚBLICA DE LA CIUDAD DE MÉXICO CORRESPONDIENTE AL EJERCICIO DE 2019. POR TAL MOTIVO SOLICITA QUE DENTRO DE UN PLAZO DE 10 DÍAS HÁBILES, CONTADOS A PARTIR DEL DÍA SIGUIENTE DE LA RECEPCIÓN DEL PRESENTE, ENVÍE LA INFORMACIÓN Y DOCUMENTACIÓN COMPLEMENTARIAS QUE SE INDICAN EN EL ANEXO, A EFECTO DE ATENDER LAS RECOMENDACIONES REFERIDAS. ASIMISMO SOLICITA QUE LA RESPUESTA SEA REMITIDA A LOS CORREOS QUE SE MENCIONAN EN EL OFICIO.', 3, '2021-09-01 01:32:02', 5),
(3108, 'S/N', '2021-09-01', 2, 586, 507, '2021-09-01', '10:30:19.000', 2, 'SOLICITA LE SEA PROPORCIONADO EL NUEVO FORMATO DE SEGURO DE VIDA INSTITUCIONAL Y LAS NUEVAS CONDICIONES GENERALES DE TRABAJO. ASIMISMO INFORMA QUE ES TRABAJADOR SIN AFILIACIÓN SINDICAL E INFORMA QUE ESTA ADSCRITO A LA COMISIÓN DE ASUNTOS POLÍTICO ELECTORALES, COMO SE DETALLA EN EL OFICIO.', 3, '2021-09-01 15:47:17', 5),
